              >
                <span aria-hidden="true"> &times; </span>
              </button>
            </div>
            <div class="modal-body">
              <form @submit.prevent="setPW">
                <div class="form-group">
                  <div v-if="isSecure" id="pwBoxes" class="form-inline row">
                    <div class="form-group col-sm-6">
