                        type="password"
                        v-on:keyup="check"
                      />
                    </div>
                  </div>
                  <div v-if="isSecure" class="form-inline row mt-2">
                    <div class="form-group col-sm-12">
                      <label class="text-danger">
                        {{ passwordError() }}
                      </label>
                    </div>
                  </div>
                </div>
                <div class="form-group">
                  <div class="form-check">
                    <input
                      id="secureToggle"
                      v-model="isSecure"
                      class="form-check-input"
                      type="checkbox"
                      value=""
                    />
                    <label class="form-check-label" for="secureToggle">
                      Use password protected wallet file format
                    </label>
                  </div>
                </div>
              </form>
            </div>
            <div class="modal-footer">
              <button
                type="button"
                class="btn btn-secondary"
                data-dismiss="modal"
              >
                Cancel
              </button>
              <button
                v-if="isSecure"
                :class="isValidated()"
                type="button"
                data-dismiss="modal"
                v-on:click="saveJSON"
              >
                Save encrypted
              </button>
              <button
                v-if="!isSecure"
                class="btn btn-danger"
                type="button"
                data-dismiss="modal"
                v-on:click="saveJSON"
              >
                Save unencrypted
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
    <div class="container mt-5 mb-5 p-5 shadow" id="regenArea">
      <div class="row justify-content-center">
        Enter hexseed/mnemonic to regenerate a wallet JSON file or PDF
      </div>
      <div class="row justify-content-center">
        <form>
          <div class="form-group">
            <div class="form-inline row">
              <div class="form-group">
                <input
                  id="inputHexseedMnemonic"
                  v-model="hexseedMnemonic"
                  class="form-control"
                  type="password"
                />
              </div>
            </div>
          </div>
        </form>
      </div>
      <div class="row justify-content-center mt-3">
        <button
          v-if="!generated"
          id="startRegeneration"
          class="btn btn-primary"
          v-on:click="generateWallet(true)"
        >
          Regenerate
        </button>
      </div>
      <div class="row justify-content-center mt-3">
        <p id="errorM"></p>
      </div>
